import React from 'react'
import { Form } from 'react-bootstrap'

const SignUp = () => {
  return (
    <div>
      <Form>
        <h1>Welcome</h1>
        <h3>Sign Up</h3>
      </Form>
    </div>
  )
}

export default SignUp
